import { useQuery } from "@tanstack/react-query"
import { endpoints } from "../Endpoints/endpoints"
import { users } from "../helper/extrapropertise"
import LoadingSpinner from "../GenericComponent/LoadingSpinneer"
import DataView from "../GenericComponent/Dataview"
import { Button, SafeAreaView, View, Text } from "react-native-web"
import { useTailwind } from "tailwind-rn"

const Card = ({ item }) => {
    console.log(item);
    const tailwind = useTailwind();
    return (
        <SafeAreaView style={tailwind('h-full')}>
            <View style={tailwind('pt-12 items-center')}>
                <View style={tailwind('bg-blue- px-3 py-1 rounded-full')}>
                    <Text style={tailwind('text-blue-800 font-semibold')}>
                        {item.name}
                    </Text>
                </View>
            </View>
        </SafeAreaView>
    )
}

export const Users = () => {
    const queryKey = [users]
    const queryFunction = async () => {
        var data = await endpoints.Users.getAll()
        console.log(data);
        return data
    }
    const getValueToSearch = (current) => {
        return (
            current.name
        )
    }

    return (
        <SafeAreaView>
            <DataView
                queryFunction={queryFunction}
                queryKey={queryKey}
                getSearchableValue={getValueToSearch}
                Card={Card}
            />
        </SafeAreaView>
    )

}
